import React from 'react';
import ReactDOM from 'react-dom';
import './index.css'
// import Dice0 from "../../assets/img/dice-0.png";
import Dice1 from "../../my-app/src/img/1.png";
import Dice2 from "../../my-app/src/img/2.png";
import Dice3 from "../../my-app/src/img/3.png";
import Dice4 from "../../my-app/src/img/4.png";
import Dice5 from "../../my-app/src/img/5.png";
import Dice6 from "../../my-app/src/img/6.png";

const DICE_IMAGES = {
  0: Dice0,
  1: Dice1,
  2: Dice2,
  3: Dice3,
  4: Dice4,
  5: Dice5,
  6: Dice6,
};

// function Dice({number, callback, state}) {
  const Dice = (props) => {
    const diceEls = props.values.map((val, i) => (
      <img
        key={`dice-${i}`}
        src={DICE_IMAGES[val]}
        alt={`dice-${val}`}
        style={val ? { boxShadow: "0 0 10px 5px #ccc" } : {}}></img>
    ));
    return <div className="Dice">{diceEls}</div>;
  };



  // return <div>
  // <div className = "Dice" src="Dice1" >{callback}</div>
  // </div>



export default Dice;
